import{_ as a,c as n,o as e,a4 as t}from"./chunks/framework.Dx5AVRXu.js";const u=JSON.parse('{"title":"fnOS 常见问题解答","description":"","frontmatter":{},"headers":[],"relativePath":"fnos/question.md","filePath":"fnos/question.md","lastUpdated":1725087001000}'),o={name:"fnos/question.md"},s=t('<h1 id="fnos-常见问题解答" tabindex="-1">fnOS 常见问题解答 <a class="header-anchor" href="#fnos-常见问题解答" aria-label="Permalink to &quot;fnOS 常见问题解答&quot;">​</a></h1><h2 id="fnos-系统安装在哪里" tabindex="-1">fnOS 系统安装在哪里？ <a class="header-anchor" href="#fnos-系统安装在哪里" aria-label="Permalink to &quot;fnOS 系统安装在哪里？&quot;">​</a></h2><p>fnOS 安装在 SSD 硬盘上，如果是 128G 的硬盘，系统只会占用大约 60~70G 的空间。实测使用 16G 的傲腾 M10 SSD 也可以顺利安装，系统也可以正常升级。</p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/ZsCnwY_pxBpNX.png" alt="ZsCnwY_pxBpNX"></p><h2 id="fnos-开关机很快吗" tabindex="-1">fnOS 开关机很快吗？ <a class="header-anchor" href="#fnos-开关机很快吗" aria-label="Permalink to &quot;fnOS 开关机很快吗？&quot;">​</a></h2><p>快！非常快！实测系统装在 SSD 上，开机只需要不超过 20s，关机只需要不到 10s。</p><h2 id="fnos-支持硬盘休眠吗" tabindex="-1">fnOS 支持硬盘休眠吗？ <a class="header-anchor" href="#fnos-支持硬盘休眠吗" aria-label="Permalink to &quot;fnOS 支持硬盘休眠吗？&quot;">​</a></h2><p>支持。</p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/sipi22us.jph_7A6HOa.png" alt="sipi22us.jph_7A6HOa"></p><h2 id="fnos-的兼容性怎么样" tabindex="-1">fnOS 的兼容性怎么样？ <a class="header-anchor" href="#fnos-的兼容性怎么样" aria-label="Permalink to &quot;fnOS 的兼容性怎么样？&quot;">​</a></h2><p>fnOS 基于 Debian 开发，兼容性很好。实测在华擎 N3150 这种较老主板，以及倍控 N100 这种比较新的主板都可以正常安装运行，而且非常流畅，多个网口也可以正常识别。</p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/9WrxAt_C7CzDr.png" alt="9WrxAt_C7CzDr"></p>',12),r=[s];function i(c,p,f,h,d,l){return e(),n("div",null,r)}const m=a(o,[["render",i]]);export{u as __pageData,m as default};
